import React from 'react';

const References = () => (
  <div>
    <h2>References</h2>
    <p>
      "John is an excellent developer with a keen eye for detail." - Jane Smith, Manager at ABC Corp
    </p>
    <p>
      "A highly reliable and innovative team member." - Bob Johnson, Colleague at XYZ Inc.
    </p>
  </div>
);

export default References;
